import React from 'react';
import { TextField } from '../../components/TextField';

const TextFieldDemo = () => {
  return (
    <React.Fragment>
      <div>
        <p>This is a Disabled Input</p>
        <TextField name="disable" disabled={disabled} />
      </div>

      <div>
        <p>A Valid Input</p>
        <TextField name="valid" />
      </div>

      <div>
        <p>An Input with errors</p>
        <TextField error name="error" isError={isError} />
      </div>
    </React.Fragment>
  );
};

export default TextFieldDemo;
